		let v2 = tofn(params, alasql);

		// Set link
		edge.$in = [v1.$id];
		edge.$out = [v2.$id];

		// Initialize and set sides
		v1.$out = v1.$out || [];
		v1.$out.push(edge.$id);

		v2.$in = v2.$in || [];
		v2.$in.push(edge.$id);

		// Save in objects
		db.objects[edge.$id] = edge;
		res = edge;

		// Optional functions
